import React from 'react'
import { Link } from 'react-router-dom'

//Este componente debera ser estilado como "dark" o "light" dependiendo del theme del Context

const Navbar = () => {

  const { theme, handleChangeTheme } = useContext();

  return (
    <nav className="nav">

      
      <Link to="/" className="site-title">DH Odonto</Link>
      <ul>
        <Link to="/">Home</Link>
        <Link to="/contact">Contact</Link>
        <Link to="/favs">Favs</Link>
        <button className="navButton" onClick={handleChangeTheme}
        style={{background:theme.background, color:theme.font}}>Change theme</button>
      </ul>
    </nav>
  )
}

export default Navbar
